import React from 'react';
import {Navbar, Container} from 'react-bootstrap'

const NaviBar = () =>{
  return (
    <Navbar bg="dark" variant="dark">
    <Container>
      <Navbar.Brand>LOGO</Navbar.Brand>
    </Container>
  </Navbar>
  )
}

export default NaviBar
